import React from 'react';
import Row from './Row';

const Grid = ( { grid, setGrid, setDisable, numberOfCells, setNumberOfCells }) => {

  return (
    <div className="grid">
      <div>
        {grid.map((row, i)=> {
          return <Row row={row} key={i} setGrid={setGrid} 
                      setDisable={setDisable}
                      numberOfCells={numberOfCells}
                      setNumberOfCells={setNumberOfCells}/>
        })}
      </div>
    </div>
  )
}

export default Grid
